import React from "react";
import classes from "./MealItem.module.css";

const MealItem = (props) => {
  const price = `$${props.price.toFiexd(2)}`;

  return (
    <li>
      <div className={classes.meal}>
        <h3>{props.name}</h3>
        <div>{props.description}</div>
        <div>{price}</div>
      </div>
    </li>
  );
};

export default MealItem;
